import './App.css';
import axios from 'axios'
import React, {useEffect, useState} from 'react'

const RandomUser = () => {
  return axios
    .get("https://randomuser.me/api")
    .then(({data}) => {
      console.log(data)
      return data
    })
    .catch((err) => {
      console.log(err)
    })
}




function App() {

  const [randomUserJSON, setRandomUserJSON] = useState('')
  const [userInfo, setUserInfo] = useState([])

  useEffect(() => {
    RandomUser().then((randomData) => {
      setRandomUserJSON(JSON.stringify(randomData , null , 2 || 'No User Data Found! (404)'))
      setUserInfo(randomData.results)

    })
  }, [])



  return (
    <>
    {
      userInfo.map((userinfo, idx) => {
        <div key={idx} >
          <p>{userinfo}</p>
        </div>

      })
    }
    </>
  );
}

export default App;
